Compounds of the general formula
  wherein A is CH or N;
 X is F, Cl or Br; R, is H or C 1 -C 4  alkyl R 2  is alkyl, cycloaklyl or optionally substituted phenyl; and their salts with protic acids, and complexes with metal ions; exhibit potent fungicidal activity. The compounds may be used for controlling fungal diseases of plants. The novel compounds may be made by reacting a corresponding starting material wherein X is OH with a suitable halogenating agent.

 This invention provides compounds of formula I, 

wherein 

R is hydrogen or alkyl of 1-6 carbon atoms; 

R is hydrogen, alkyl of 1-6 carbon atoms, acyl of 2-7 carbon atoms, or aroyl; 

 R ₁ , R ₂ , R ₃ , and R ₄ are each, independently, hydrogen, alkyl of 1-6 carbon atoms, alkoxy of 1-6 carbon atoms, halogen, trifluoroalkyl, or trifluoroalkoxy of 1-6 carbon atoms; 

 X is CR ₅ R ₆ or a carbonyl group; 

 R ₅ and R ₆ are each, independently, hydrogen or alkyl of 1-6 carbon atoms; 

 or a pharmaceutically acceptable salt thereof, with the proviso that at least two of R ₁ , R ₂ , R ₃ , or R ₄ are not hydrogen; 

 which are 5HT _{2C } receptor agonists useful for the treatment of disorders involving the central nervous system such as obsessive-compulsive disorder, depression, anxiety, schizophrenia, migraine, sleep disorders, eating disorders, obesity, type II diabetes, and epilepsy.

This invention provides compounds of formula I, 

R is hydrogen or alkyl of 1-6 carbon atoms; 

R is hydrogen, alkyl of 1-6 carbon atoms, acyl of 2-7 carbon atoms, or aroyl; 

R _{ 1 } , R _{ 2 } , R _{ 3 } , and R _{ 4 } are each, independently, hydrogen, alkyl of 1-6 carbon atoms, alkoxy of 1-6 carbon atoms, halogen, trifluoroalkyl, CN, alkyl sulfonamide of 1-6 carbon atoms, alkyl amide of 1-6 carbon atoms, amino, alkylamino of 1-6 carbon atoms, dialkylamino of 1-6 carbon atoms per alkyl moiety, trifluoroalkoxy of 1-6 carbon atoms, acyl of 2-7 carbon atoms, or aroyl; 

X is CR _{ 5 } R _{ 6 } or a carbonyl group; 

R _{ 5 } and R _{ 6 } are each, independently, hydrogen or alkyl of 1-6 carbon atoms; 

or a pharmaceutically acceptable salt thereof, with the proviso that at least one of R _{ 1 } , R _{ 2 } , R _{ 3 } , or R _{ 4 } are not hydrogen; 

which are 5HT _{ 2C } receptor agonists useful for the treatment of disorders involving the central nervous system such as obsessive-compulsive disorder, depression, anxiety, schizophrenia, migraine, sleep disorders, eating disorders, obesity, type II diabetes, and epilepsy.
